column8:
◇商品名◇<br>
サンバイザーカバー
<br><br>

◇適合車種◇<br>
ハイエース 200 標準車<br>
・SGL/DX <br>
・1型 2型 3型前期<br><br>

※ワイド非対応

<br><br>

◇カラー◇<br>
PVCレザー ブラック
<br><br>

◇商品説明◇<br>
ミラー窓やカードホルダー、<br>
ティッシュ収納ポケットなど・・・。<br>
多機能でありながらも上品な印象に仕上げた<br>
インテリアをトータルでコーディネートする際に<br>
欠かすことの出来ない商品です！<br>
陽射しの強い時、対向車にインテリアドレスアップを<br>
アピールできる数少ないアイテムになってます♪<br>
車種別設計品ですので、フィット感も抜群です！
<br><br>

◇特徴・注意事項◇<br>
商品内容:<br>
運転席用&助手席用セット<br>
<br>
運転席側:<br>
・バニティミラー<br>
・カード入れ×3<br>
助手席側:<br>
・バニティミラー<br>
・ポケットティッシュ収納<br>
<br>
素材:高品質PVCレザー<br>
チケット等をはさめるベルト付き<br>
簡単ZIP留めで装着も簡単です。
<br><br>

◇送料◇<br>
全国一律540円、北海道、沖縄・離島は別途必要となります。
<br><br>



◇取引詳細◇<br>
その他詳しくは会社概要をお読みください。<br><br><br>


<p></p><br><br>



